import React from "react";
import "../css/footerBlock.css";
import logo from "../img/logo.png";

function FooterBlock() {
  return (
    <section className="footerBlock">
      <div className="containerFooter">
        <h2>ТОО Сарыарка Клиник, Клиника Профессора Жанбырбек Уланбека</h2>
        <h3>
          г. Астана | <a href="tel:+7472222222">Телефон: +7(747)222-22-22</a>
        </h3>
      </div>
    </section>
  );
}
export default FooterBlock;
